def check_string(s):

    def is_alpha(c):
        if ('a' <= c and c <= 'z') and ('A' <= c and c <= 'Z'):
            return True
        return False

    def to_lower(c):
        if 'A' <= c and c <= 'Z':
            return chr(ord(c) + 32)
        return c

    def sort_freq(freq):
        for i in range(len(freq)):
            for j in range(i + 1, len(freq)):
                if freq[i][1] < freq[j][1]:
                    (freq[i], freq[j]) = (freq[j], freq[i])
        return freq

    def count_freq(s):
        freq = []
        for _ in range(26):
            freq.append([chr(ord('a') + _), 0])
        for c in s:
            if is_alpha(c):
                freq[ord(to_lower(c)) - ord('a')][1] += 1
        return sort_freq(freq)
    for c in s:
        if not is_alpha(c):
            return (False, 'The string contains non-alphabetical characters.')
    freq = count_freq(s)
    return (True, [(c, f) for (c, f) in freq if f != 0])

